import * as React from 'react';
import api from './api'


export function getUsers(){
const [resp, setResp] = React.useState([]);

  api
  .get("/v1/")
  .then((response) => ((setResp(response.data))))
  .catch((err) => {
    console.error("ops! ocorreu um erro" + err);
  });

    return resp;
}   

export function getUser(id : String){
  api
  .get("/v1/" + id)
  .then((response) => ((setResp(response.data))))
  .catch((err) => {
    console.error("ops! ocorreu um erro" + err);
  });

    return resp;
}
